        public IEnumerable<string> Variants { get; } 

        public BushuRadicalClassical(string displayName, int number, string radical, IEnumerable<string> variants = null)
            : base(displayName)
        {
            this.Radical = radical;
            this.Number = number;
            this.Variants = variants ?? new List<string>();
        }

        public override string ToString()
        {
            return $"{this.Type} #{this.Number.ToString().PadLeft(3, '0')} ({this.Radical})";
        }
    }
}